import React from "react";
import { Chart } from "react-google-charts";

export const data = [
  ["Year", "Sales"],
  ["2014", 200],
  ["2015", 70],
  ["2016", 660],
  ["2017", 30],
];

export const options = {
  chart: {
    title: "Company Performance",
    subtitle: "Sales: 2014-2017",
  },
};

export function Bar() {
  return (
    <Chart
      chartType="Bar"
      width="100%"
      height="400px"
      data={data}
      options={options}
    />
  );
}
